sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var inputs = SapRFCUtil.EscapeHTMLInjection(inputs);
        var inputs = SapRFCUtil.trimInputs(inputs);

        inputs.item = SapRFCUtil.filterArrayObjects(inputs.item);

        //Validate mandatory fields
        var mandatoryFieldsList = {
            "Transaction Code for Goods Movement": inputs.code,
            "Material Document Header > Posting Date": inputs.header.PSTNG_DATE,
            "Material Document Header > Document Date": inputs.header.DOC_DATE
        };

        if (inputs.item.length != 0) {
            var itemdataArr = inputs.item;
            for (var index = 0; index < itemdataArr.length; ++index) {
                var itemdataNum = index + 1;
                var itemdataElement = 'item [' + itemdataNum + ']';
                mandatoryFieldsList[itemdataElement + " > Movement Type"] = itemdataArr[index].MOVE_TYPE;
                mandatoryFieldsList[itemdataElement + " > Quantity in Unit of Entry"] = itemdataArr[index].ENTRY_QNT;
                mandatoryFieldsList[itemdataElement + " > Purchase Order"] = itemdataArr[index].PO_NUMBER;
                mandatoryFieldsList[itemdataElement + " > Item"] = itemdataArr[index].PO_ITEM;
                mandatoryFieldsList[itemdataElement + " > Movement Indicator"] = itemdataArr[index].MVT_IND;
            }
        }

        var emptyFields = SapRFCUtil.checkMandatoryFields(mandatoryFieldsList);
        if (JSUtil.notNil(emptyFields)) {
            throw 'Mandatory field(s) '.concat(emptyFields) + ' cannot be blank.';
        }

        var info = SapRFCUtil.getConnectionFromAlias(inputs.alias_id);
        outputs.conn_host = info.getAttribute("host");
        outputs.conn_params = info.getExtendedAttributes();

        var connId = info.getAttribute("sys_id");
        outputs.cred_id = SapRFCUtil.getCredentialIdFromConnection(connId);

        var code = {
            GM_CODE: inputs.code
        };

        var payload = SapRFCUtil.unflattenPayload(inputs.additional_in);
        if (inputs.bapi == "BAPI_GOODSMVT_CREATE") {
            payload['GOODSMVT_HEADER'] = inputs.header;
            payload['GOODSMVT_CODE'] = code;
            if (inputs.item.length != 0) {
                payload['GOODSMVT_ITEM'] = inputs.item;
            }
        } else if (inputs.bapi == "ZSN_BAPI_GOODSMVT_CREATE") {
            payload['IV_GOODSMVT_HEADER'] = inputs.header;
            payload['IV_GOODSMVT_CODE'] = code;
            if (inputs.item.length != 0) {
                payload['IT_GOODSMVT_ITEM'] = inputs.item;
            }
        } else
            throw "The selected BAPI is not valid."

        outputs.payload = SapRFCUtil.removeMetaNameField(payload);
    } catch (e) {
        throw e;
    }
})(inputs, outputs);

